import React from 'react'
import testimonies from '../../assets/fake-data/testimonies'

var lol = [];
const Testimony = () => {
    testimonies.map((item, index) => (
        lol = item.content
    ))
    return (
        lol.map((item, index) => (
            <p key={index}>{index}</p>
        ))
    )
}

export default Testimony
